import React from "react";
import './NavBar.css';
import { motion } from 'framer-motion';
import { Container } from 'react-bootstrap';
import Nav from 'react-bootstrap/Nav';
import { Navbar } from "react-bootstrap";


function NavBar() {
    return(
        <Navbar expand='lg' className='position-absolute w-100 z-2'>
            <Container>
                <motion.a
                    className='navbar-brand text-light'
                    href='./'
                    initial={{opacity:0 }}
                    whileInView={{opacity:1 }}
                    transition={{duration:1 }} 
                >
                    <img src=''/>
                        <span className="text-uppercase fw-bold text-purple">Springdale Public School
                        </span>
                </motion.a>
                <Navbar.Toggle
                    aria-controls="basic-navbar-nav"/>
                <Navbar.Collapse id="basic-navbar-nav"
                className="p-3 p-lg-0 mt-2 mt-lg-0">
                    <motion.ul 
                        className="navbar-nav me-auto justify-content-end w-100"
                        initial={{opacity:0 }}
                        whileInView={{opacity:1}}
                        transition={{duration:1 }}
                        >
                            <Nav.Link href='#' className="text-light text-uppercase">Home</Nav.Link>
                            <Nav.Link href='#about' className="text-light text-uppercase">About</Nav.Link>
                            <Nav.Link href='#' className="text-light text-uppercase">Academics</Nav.Link>
                            <Nav.Link href='#' className="text-light text-uppercase">Home</Nav.Link>
                            <Nav.Link href='#' className="text-light text-uppercase">Home</Nav.Link>
                            <Nav.Link href='#' className="text-light text-uppercase">Home</Nav.Link>
                    </motion.ul> 
                </Navbar.Collapse>
            </Container>

        </Navbar>
    )
}

export default NavBar;
